// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.7;

import "./Token.sol";

contract Voting {

    string name;

    uint startTime;

    uint endTime;

    mapping (address => bool) voters;

    mapping (address => bytes32) public proposals;

    address chairperson;

    Token token = new Token();

    constructor (string memory _name, uint _startTime, uint _endTime) {

        chairperson = msg.sender;
        name = _name;
        startTime = _startTime;
        endTime = _endTime;
    }

    function addVoters(address[] memory _voters) public {
        
        for (uint i = 0; i < _voters.length; i++) {
            voters[_voters[i]] = false;
            token.mint(_voters[i], 1); 
        }
        token.mint(chairperson, 1); 
    }

    function addProposals(address[] memory _proposalsAddr, 
                         bytes32[] memory _proposalsNames) public {

        require(_proposalsAddr.length != _proposalsNames.length);

        for (uint i = 0; i < _proposalsAddr.length; i++) {
            proposals[_proposalsAddr[i]] = _proposalsNames[i];
        }
    }

    function vote(address proposal) public {
        require(block.timestamp > endTime);
        require(voters[msg.sender]);
        require(token.balanceOf(msg.sender) == 0); // на балансе нет токена
        // авторизован ли избиратель или председатель

        token.transferFrom(msg.sender, proposal, 1);
        voters[msg.sender] = true;
    }

    function totalVotesFor(address proposal) view public returns (uint) {
        require(block.timestamp < endTime);
        require(msg.sender != chairperson);

        return token.balanceOf(proposal);
    }


}

